import React, { Component } from "react";
import Navbar from "../../components/Navbar";
import Jumbotron from "../../components/Jumbotron";
import "./style.css";



function Home() {
    return (
        <div>
            <div className="main">
                <div className="container">
                        <Navbar/>
                        <Jumbotron/>
                </div>
            </div>
            <div className="about-us">
                <div className="container">
                    <div className="about-text">
                        <h2>
                        About Us
                        </h2>
                    </div>
                </div>
            </div>
        </div>
    )
}
 
export default Home;
